import textwrap, pprint
from math import gcd
from collections import Counter


alphabet = {'a' : 0, 'b' : 1, 'c' : 2, 'd' : 3, 'e' : 4, 'f' : 5,'g':6,'h':7,'i':8,'j':9,'k':10,'l':11,'m':12,'n':13,'o':14,'p':15,'q':16,'r':17,'s':18,'t':19,'u':20,'v':21,'w':22,'x':23,'y':24,'z':25}
frequent_letters = ['e','t','a','o','i','n','s','h','r','d','l','c','u','m','w','f','g','y','p','b','v','k','j','x','q','z']
pp = pprint.PrettyPrinter(indent=4)

def egcd(a, b):
    if a == 0:
        return (b, 0, 1)
    else:
        g, y, x = egcd(b % a, a)
        return (g, x - (b // a) * y, y)

def modinv(a):
    g, x, y = egcd(a, 26)
    if g != 1:
        print('modular inverse does not exist')
    else:
        return x % 26

def en_affine(message, a, b):
	global alphabet
	enciphered = ''
	if gcd(a,26) == 1:
		for i in message.lower():
			enc_numb = (alphabet[i]*a + b)%26
			enciphered += list(alphabet.keys())[list(alphabet.values()).index(enc_numb)]
		print(message + ', was enciphered to: ' + enciphered.upper())
	else:
		print('a must be coprime to 26.')

def de_affine(ciphertext, a, b):
	global alphabet
	deciphered = ''
	new_a = modinv(a)
	for i in ciphertext.lower():
		dec_numb = (alphabet[i]*new_a - b*new_a)%26
		deciphered += list(alphabet.keys())[list(alphabet.values()).index(dec_numb)]
	print(ciphertext + ', was deciphered to: ' + deciphered)

def en_cae(message):
	en_affine(message, 1, 3)

def de_cae(ciphertext):
	de_affine(ciphertext, 1, 3)

def en_vigenere(message, codeword):
	global alphabet
	enciphered = ''
	posit = 0
	if len(codeword) > 0:
		for i in message.lower():
			posit = posit%len(codeword)
			enc_numb = (alphabet[i] + alphabet[codeword[posit]])%26
			enciphered += list(alphabet.keys())[list(alphabet.values()).index(enc_numb)]
			posit += 1
		print(message + ', was enciphered to: ' + enciphered.upper())
	else:
		print('Your codeword must be at least one character long')

def de_vigenere(ciphertext, codeword):
	global alphabet
	deciphered = ''
	posit = 0
	if len(codeword) > 0:
		for i in ciphertext.lower():
			posit = posit%len(codeword)
			dec_numb = (alphabet[i] - alphabet[codeword[posit]])%26
			deciphered += list(alphabet.keys())[list(alphabet.values()).index(dec_numb)]
			
			posit += 1
		print(ciphertext + ', was deciphered to: ' + deciphered)
	else:
		print('Your codeword must be at least one character long')

def vig_fre_ana(ciphertext):
	global frequent_letters
	global alphabet
	ciphertext = ciphertext.upper()
	trigrams = dict()
	counter = 0
	while counter<(len(ciphertext)-2):
		cur_trigram = ciphertext[counter]+ciphertext[counter+1]+ciphertext[counter+2]
		if cur_trigram not in trigrams:
			trigrams[cur_trigram] = 1
		else:
			trigrams[cur_trigram] += 1
		counter+=1
	most_common_trigrams = dict(Counter(trigrams).most_common(10))
	pp.pprint(most_common_trigrams)

	temp_key = ''
	temp_value = 0
	for i in most_common_trigrams:
		if most_common_trigrams[i] > temp_value:
			temp_value = most_common_trigrams[i]
			temp_key = i
		else:
			pass
	the_most_common_trigram = temp_key
	print('Most common Trigram is ' + the_most_common_trigram)

	#Now find distance between each of the most common
	trigram_spacings = dict()
	for i in most_common_trigrams:
		print('Currently working on: ' + i)
		spacings = dict()
		s_spacing = 0
		s_spacing_js = False
		counter = 0
		while counter<(len(ciphertext)-2):
			cur_trigram = ciphertext[counter]+ciphertext[counter+1]+ciphertext[counter+2]
			if (cur_trigram == i) and not s_spacing_js:
				s_spacing = counter
				s_spacing_js = True
			elif (cur_trigram == i) and s_spacing:
				c_spacing = counter - s_spacing
				if c_spacing not in spacings:
					spacings[c_spacing] = 1
				else:
					spacings[c_spacing] += 1
				s_spacing_js = False
			else:
				pass
			counter += 1
		trigram_spacings[i] = spacings
	most_common_trigram_spacings = dict()
	for j in trigram_spacings:
		most_common_trigram_spacings[j] = dict(Counter(trigram_spacings[j]).most_common(10))
	pp.pprint(most_common_trigram_spacings)

	#Find gcd of most common ones
	gcds = dict()
	for i in most_common_trigram_spacings:
		cur_spacings = list()
		gcds[i] = list()
		for j in most_common_trigram_spacings[i]:
			cur_spacings.append(j)
		for j in cur_spacings:
			for k in cur_spacings:
				gcds[i].append(egcd(j,k)[0])
	pp.pprint(gcds)

	#Assume this gcd is codeword length
	average_gcds = list()
	for i in gcds:
		average_gcds.append(int(Counter(gcds[i]).most_common(1)[0][0]))
	codeword_length = int(sum(average_gcds)/len(average_gcds))
	print('Codeword Length: ' + str(codeword_length))

	#Do frequency analysis on letters with spacing of codeword
	counter_1 = 0
	letter_frequency = dict()
	while counter_1 < codeword_length:
		counter_2 = counter_1
		letter_frequency[counter_1] = dict()
		while counter_2<len(ciphertext):
			cur_letter = ciphertext[counter_2]
			if cur_letter not in letter_frequency[counter_1]:
				letter_frequency[counter_1][cur_letter] = 1
			else:
				letter_frequency[counter_1][cur_letter] += 1
			counter_2 += codeword_length
		counter_1 += 1
	pp.pprint(letter_frequency)
	#For each letter of the codeword 0-4 in this case match them up with
	#thier potential letter and find shift, if all agree (first 4 say)
	#then move on knowing the ith letter
	mc_letter_frequency = dict()
	codeword = ''
	for codeword_letter_pos in letter_frequency:
		#Find top 4 letters in desc order
		mc_letter_frequency[codeword_letter_pos] = dict(Counter(letter_frequency[codeword_letter_pos]).most_common(1))
		#Now order these desc
		mc_letter_frequency[codeword_letter_pos] = sorted(mc_letter_frequency[codeword_letter_pos], key=lambda k: mc_letter_frequency[codeword_letter_pos][k])
		shifts = set()
		counter_a = 0
		for i in mc_letter_frequency[codeword_letter_pos]:
			#Get num of letter
			letter_num = alphabet[i.lower()]
			#get num of guess
			guess_num = alphabet[frequent_letters[counter_a]]
			#get shift
			if letter_num - guess_num >= 0:
				shifts.add((letter_num - guess_num)%26)
			else:
				shifts.add((guess_num - letter_num)%26)
			counter_a+=1
		#if agrees then get letter
		if len(shifts) == 1:
			codeword += list(alphabet.keys())[list(alphabet.values()).index(next(iter(shifts)))]
			print('The' + str(codeword_letter_pos) + 'th codeword letter is ' + codeword[codeword_letter_pos])
		else:
			print('DAMN')

	#Now that I have the codeword decrypt the cipher
	de_vigenere(ciphertext, codeword)


